### Summary of Core Topics, Concepts, Principles, and Equations

The exam focuses on several key areas in English language and grammar. Here are the core topics, concepts, and principles that are essential to study:

#### 1. **Discourse Markers**
- **Concept:** Words or phrases that connect ideas and show the relationship between them.
- **Examples:** As a matter of fact, furthermore, truly, however, unless.

#### 2. **Grammar and Sentence Structure**
- **Tenses and Aspects:**
  - **Present Continuous Tense:** Used for actions happening now or around the current time.
    - **Example:** She is ruling this land.
  - **Past Continuous Tense:** Used for actions that were happening at a specific moment in the past.
    - **Example:** They were playing football.
  - **Future Perfect Tense:** Used for actions that will be completed by a certain future time.
    - **Example:** The Capisi home will have sat on the edge of the low-rent section.
- **Verb Moods:**
  - **Subjunctive Mood:** Used to express various states of unreality such as doubt, possibility, necessity, or action that has not yet occurred.
    - **Example:** If I were the Prime Minister, I would ensure equality for all.
- **Adverbial Clauses:**
  - **Adverbial Clause of Time:** Provides information about when something happens.
    - **Example:** Since he was a baby.
- **Adverbs and Adjectives:**
  - **Adverb of Manner:** Describes how an action is performed.
    - **Example:** Well (in "I slept well").
  - **Adjectives:** Describe nouns.
    - **Example:** Sick, intensive (in "A sick Sharmila had to be provided intensive care").

#### 3. **Figures of Speech**
- **Pun:** A play on words that sound similar but have different meanings.
  - **Example:** "Ask for me tomorrow and you shall find me a grave man."
- **Simile:** A comparison using "like" or "as."
  - **Example:** "Blind as a bat."
- **Personification:** Giving human characteristics to non-human things.
  - **Example:** "The city never sleeps."
- **Oxymoron:** A figure of speech that juxtaposes elements that appear to be contradictory.
  - **Example:** "Pretty ugly."

#### 4. **Sentence Types and Clauses**
- **Complex Sentences:** Sentences that contain an independent clause and at least one dependent clause.
  - **Example:** "The children who ran fast will have the best chance to return before breakfast."
- **Adjectival Clauses:** Clauses that function as adjectives.
  - **Example:** "which turns like an eagle in mid-flight" (in "Gary spins the ball, which turns like an eagle in mid-flight").

#### 5. **Conjunctions and Connectors**
- **Coordinating Conjunctions:** Words that connect words, phrases, or clauses that are independent or equal.
  - **Example:** "so" (in "He was feeling mighty thirsty, so we went to the bar").

#### 6. **Logical/Semantic Roles**
- **Instrument:** The role of a noun phrase that indicates the tool or means by which an action is performed.
  - **Example:** "with a new knife" (in "Sethu cut the bread with a new knife").

#### 7. **Passive Voice**
- **Concept:** A sentence structure where the subject receives the action.
  - **Example:** "The medal is taken by Sajal" (from "Sajal takes the medal").

